import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import { Typography } from '@material-ui/core';
import {Call, Email, GroupAdd, Home, LinkedIn, Facebook, Instagram, Twitter} from '@material-ui/icons'

export default function profileCard() {
  const classes = {
    card: {
        width: '300px',
        height:'350px'
    },
    content: {
        position: 'relative',
        bottom: '120px'
    },
    iconText: {
        position:'relative',
        bottom:'5px'
    }
  }

  const contactInfo = () => {
      return (
          <div>
              <Call /> <span style={classes.iconText}>760-421-1563</span>
              <Email /> <span style={classes.iconText}>760-421-1563</span>
              <Call /> <span style={classes.iconText}>760-421-1563</span>
          </div>
      )
  }

  return (
    <Card  style={classes.card}>
        <CardContent>
            <Typography color="textSecondary" variant="h6"> Contact Details</Typography>
            {contactInfo()}
            <Typography color="textSecondary" > Connect With</Typography>
        </CardContent>
    </Card>
  );
}
